import React from 'react';
import './App.css';
import Home from './pages/Home.js';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
function App() {
  return (
    <div className="App">

      <Router>
        <Switch>

          <Route path='/search'>
          <h1>this is the search page</h1>
            {/* <SearchPage /> */}
          </Route>

          <Route path='/'>
          <h1>this is home page</h1>
            <Home />
          </Route>

        </Switch>

      </Router>


    </div>
  );
}

export default App;
